Estoy intentando crear un Tutorial sobre una de las variantes del PatrÃ³n de diseÃ±o Singleton usado en C++ que se conoce como Singleton estÃ¡tico. Te paso la informaciÃ³n que aparece en el libro que estoy usando. 
Static singleton
One of the simplest implementations of the singleton pattern is a static singleton. In this implementation, the object has only static data members:

class Singleton {
 public:
 Singleton() {}
 int& get() { return value\_; }
 private:
 static int value\_;
};
int Singleton::value\_ = 0;
For the rest of this section, we will consider a singleton with one integer data member, and the member functions that provide access to it. We do this only for the sake of a concrete exampleâ€”the real-life implementation can have an arbitrary number of data members of different types, and an arbitrarily complex API that's provided by the member functions.

The member functions may be static or not. If the member functions are not static, the implementation may be classified as a multiple handle objects, one data type, because to access the singleton, the programmer simply constructs a Singleton object as many times as needed:

Singleton S;
int i = S.get();
++S.get();
The object may even be constructed on the fly, as a temporary variable:

int i = Singleton().get();
++Singleton().get();
There is no actual construction, that is, no code is generated or executed at runtime to construct this objectâ€”after all, there is nothing to construct, as all data is static. We can expect this singleton to be very fastâ€”an expectation that is confirmed by the benchmark:

#define REPEAT(X)... repeat X 32 times
void BM\_singleton(benchmark::State& state) {
 Singleton S;
 for (auto \_ : state) {
 REPEAT(benchmark::DoNotOptimize(++S.get());)
 }
 state.SetItemsProcessed(32\*state.iterations());
}
In this benchmark, we use the REPEAT macro to generate 32 copies of the benchmarked code inside the loop; this is done to reduce the overhead of the loop, since each iteration is very short:
The alternative use of the singleton, where a temporary object is created every time, can be benchmarked just as easily:

void BM\_singletons(benchmark::State& state) {
 for (auto \_ : state) {
 REPEAT(benchmark::DoNotOptimize(++Singleton().get());)
 }
 state.SetItemsProcessed(32\*state.iterations());
}
We expect it to be equally fastâ€”an expectation that is confirmed by the following measurements:
As far as the lifetime of the singleton goes (not the handle object, the data itself), it is initialized together with all the static data in the program, some time before main() is called. It is destroyed at some point at the end of the program, after main() exits.

An alternative way is to declare not just data members, as static, but also function members, as shown here:

class Singleton {
 public:
 static int& get() { return value\_; }
 private:
 Singleton() = delete;
 static int value\_;
};
int Singleton::value\_ = 0;
In this approach, we never have to construct the Singleton object at all:

int i = Singleton::get();
++Singleton::get();
This implementation can be classified as a zero handle objects, one data type. However, in every way that matters, it is identical to the previous oneâ€”the exact syntax of the function calls is different, but what they do is the same, and so is the performance.

An important consideration is the thread safety of the singleton implementation, as well as the performance in a concurrent program. The static singleton itself is obviously thread-safeâ€”it is initialized and destroyed by the C++ runtime system, together with the rest of the static data, and no user threads can be running at that time. The thread-safe use of the singleton is always the responsibility of the programmer, of courseâ€”if the singleton provides access to modify its data, it must be protected by a mutex, or implemented in a thread-safe way. When we discuss thread safety of the singleton implementation, we focus on the initialization, destruction, and provision of access to the singleton objectâ€”these operations are part of the implementation of the pattern; the rest is specific to the program.

The thread safety of the static singleton is trivially assured, but what about performance? In this case, to access the singleton the program, all that needs to be read is the static data, so there is no overhead. Of course, there may be overhead if the program needs to synchronize modifications of this data, but that is no different from any other shared data in a concurrent program.

There are two potential downsides to this implementation. First of all, this singleton cannot be extended through inheritance. This is the less important of the two problemsâ€”singleton objects are, or should be, rare enough in a good design, so code reuse is not a significant concern.

The more important problem has to do with the object's lifetimeâ€”the singleton is initialized as a static object before the program itself is started. The order of initialization of the static objects is, in general, undefined and left to the implementationâ€”the standard guarantees that all objects defined in one file are initialized in the order of their definitions, but for objects initialized in different files, there are no guarantees at all with regard to the order.

This is not a problem if the singleton is going to be used by the program when it executes; that is, used for anything that is called from main()â€”the singleton will definitely be constructed before the program starts and will not be destroyed until after it ends. It is, however, a problem for any code in any other static object that uses this singleton. Such dependencies between static objects are not uncommonâ€”for example, if our singleton is the memory manager, and there is only one instance of such in the program, then any static object that allocates memory has to get it from the memory manager. However, unless the whole program is contained in one file, there is no way to guarantee that the singleton memory manager is initialized before its first use. The next implementation attempts to address this problem.
