Este es un texto que explica el uso de la variante del patrÃ³n singleton conocida como Singleton de Meyer. 
Meyers' Singleton
This implementation is named after its inventor, Scott Meyers. If the main problem with the static singleton is that it can be initialized later than its first use, then the solution must be to initialize the singleton when it is needed for the first time:

class Singleton {
 public:
 static Singleton& instance() {
 static Singleton inst;
 return inst;
 }

 int& get() { return value\_; }

 private:
 Singleton() : value\_(0) {
 std::cout << "Singleton::Singleton()" << std::endl;
 }
 Singleton(const Singleton&) = delete;
 Singleton& operator=(const Singleton&) = delete;
 ~Singleton() {
 std::cout << "Singleton::~Singleton()" << std::endl;
 }

 private:
 int value\_;
};
The Meyers' Singleton has a private constructor, so it cannot be constructed by the program directly (in our example, we added a printout to the constructor, only to see when the singleton is initialized). Nor can the program make copies of the singleton object. Since the Meyers' Singleton cannot be directly constructed by the program, it is again a zero handle objects implementation. The only way to access this singleton is through the Singleton::instance() static member function:

int i = Singleton::instance().get();
++Singleton::instance().get();
The Singleton::instance() function returns a reference to the singleton object, but which one, and when is it created? We can see from the preceding code that the return value is a reference to a local object defined in the body of the instance() function itself. Ordinarily, returning references to local objects is a serious programming errorâ€”these objects don't exist once the function completes. But the Meyers' Singleton doesn't use an ordinary local object, but a local static object. Just like file-static objects, only one instance of the static object exists in the entire program. Unlike the file static objects, the function static objects are initialized the first time they are used; in our case, the first time the function is called. In pseudo-code, you can think of the function-static object like this:

static bool initialized = false; // Hidden compiler-generated variable
// Memory for the static object, uninitialized at first
char memory[sizeof(Singleton)]; 
class Singleton {
 public:
 static Singleton& instance() {
 if (!initialized) { // Happens only once
 initialized = true;
 new (memory) Singleton; // Placement new
 // Calls Singleton constructor
 }
 // memory now contains a Singleton object
 return \*(Singleton\*)(memory);
 }
...
};
This initialization of the singleton may occur after the program starts, or possibly long after, if the singleton is not used for a while. On the other hand, if another static object (not necessarily a singleton) uses our singleton object and requests a reference to it, the initialization is guaranteed to happen before the object can be used. This implementation is an example of lazy initializationâ€”the initialization is deferred until it's needed (if the singleton object is not used at all in a particular run of the program, it will not be initialized at any point).

One possible concern about Meyers' Singleton is its performance. While the initialization occurs only once, every call to Singleton::instance() must check whether the object is already initialized. We can measure the cost of this check by comparing the time it takes to access the instance for some operations, compared to the time it takes to call the same operations on an instance already stored in a reference:

void BM\_singleton(benchmark::State& state) {
 Singleton& S = Singleton::instance();
 for (auto \_ : state) {
 REPEAT(benchmark::DoNotOptimize(++S.get());)
 }
 state.SetItemsProcessed(32\*state.iterations());
}

void BM\_singletons(benchmark::State& state) {
 for (auto \_ : state) {
 REPEAT(benchmark::DoNotOptimize(++Singleton::instance().get());)
 }
 state.SetItemsProcessed(32\*state.iterations());
}
Here, the first benchmark calls Singleton::instance() every time, while the second one calls the same member functions on the singleton, but accesses the instance only once. The difference between the two invocations shows us the cost of checking whether the singleton has to be initialized (the cost of the initialization itself is irrelevant, since the benchmark is executed many times, while the initialization happens only once):
We can see that the cost of the implementation of the function static variable is considerable, significantly greater than the cost of a simple operation on the singleton object (an integer increment, in our case). Therefore, if the singleton object is to be used extensively, it may be beneficial to store a reference to it, instead of requesting one every time. We can also see, thanks to the debug printouts we put in place earlier, that the singleton is indeed initialized the first time it is usedâ€”if the messages Running... and Run on... are printed by the program (by the main() function provided by the Google Benchmark library, to be exact), then the singleton is initialized. If the singleton used a file static object, the constructor would have been called before the program has a chance to print anything.

Not to be confused with Meyers' singleton is the following implementation:

class Singleton {
 public:
 static Singleton& instance() {
 return instance\_;
 }

 int& get() { return value\_; }

 private:
 Singleton() : value\_(0) {
 std::cout << "Singleton::Singleton()" << std::endl;
 }
 ~Singleton() {
 std::cout << "Singleton::~Singleton()" << std::endl;
 }
 Singleton(const Singleton&) = delete;
 Singleton& operator=(const Singleton&) = delete;

 private:
 static Singleton instance\_;
 int value\_;
};
Singleton Singleton::instance\_;
While superficially similar, this implementation differs in the most important aspectâ€”the time of initialization. The static instance is not a function static object, and is initialized with other static objects, regardless of whether it is used or not (eager initialization, as opposed to lazy initialization). The access to the singleton instance looks exactly the same as for Meyers' Singleton, but there, the similarities end. In fact, this is just another variant of the static singleton, only instead of declaring every data member as static, we created a static instance of the object.

We can expect the performance to be similar to that of the static singleton, or that of the Meyers' Singleton if we were to optimize the code to avoid repeated initialization checks:
We call the reader's attention to the timing of the construction againâ€”this time, the constructor of the static singleton instance is called before the program has started to print its own messages.

An interesting variant of this implementation is a combination of the Meyers' Singleton with the pimpl idiom, where the header file contains only the interface declarations, and the actual implementation, including the data members, is moved to a different class and hidden in the C file, with only a pointer to this implementation object declared in the header (hence the name, pointer to impl, or pimpl for short). This idiom is often used to reduce the compilation dependenciesâ€”if the implementation of the object changes, but the public API remains the same, then the header file remains unchanged and all files that depend on it do not need to be recompiled. In the case of the singleton, the combination of these two patterns looks like this:

// In the header file:
struct SingletonImpl; // Forward declaration
class Singleton {
 public: // Public API
 int& get();
 private:
 static SingletonImpl& impl();
};

// In the C file:
struct SingletonImpl { // Client code does not care if this changes
 SingletonImpl() : value\_(0) {}
 int value\_; 
};

int& Singleton::get() { return impl().value\_; }

SingletonImpl& Singleton::impl() {
 static SingletonImpl inst;
 return inst;
}
In this implementation, the program can create any number of Singleton objects, but they all operate on the same implementation, accessed by the impl() method (in our case, this method returns a reference to the implementation, and not a pointer; nonetheless, we call it pimpl since it is fundamentally the same pattern). Note that we did not put any protection on the implementation classâ€”since it is limited to one C file and is not used directly, only being used through the methods of the Singleton class, it is quite common to rely on the programmer's discipline instead.

The advantage of this implementation is a better separation between the interface and the implementation, which is the reason for any use of the pimpl idiom. The disadvantage is the extra level of indirection, and the performance overhead

